import React from "react";
import 'navigation.css';

export default function Navigation() {
    return (
        <nav>
            <div className="nav-logo">
                <span className="logo-purple">T</span>OWER <span className="logo-purple">O</span>F <span className="logo-purple">B</span>ABEL
            </div>
            <div className="nav-links"></div>
        </nav>
    );
}
